import React from "react";
import "../../index.css";

function Welcome() {
  return (
      <div>
        <div className="card-panel cyan darken-1 aboutText">
            <h4 className="center">
            Welcome to my web development portfolio!
            </h4>
            <br />
            Here, you'll see various projects I've completed while enrolled in UW's
            Full Stack Web Development BootCamp. (Feb 2020 - present)

            <br />
     
        </div>

      </div>

  );
}

export default Welcome;
